import { createRouter, createWebHistory } from 'vue-router';
import Home from '../component/HelloWorld.vue';

const router = createRouter({
    history: createWebHistory(),
    routes: [{
            path: '/',
            name: 'Dashboard',
            component: () =>
                import ('./views/HelloWorld.vue')
        },
        {
            path: '/about',
            name: 'About',
            component: () =>
                import ('./component/About.vue')
        },
        {
            path: '/Table',
            name: 'Table',
            component: () =>
                import ('./component/Table.vue')
        }
    ]
})
